import React, { Component } from 'react';
import classes from './GST_Registration.module.css';

class GstRegistration extends Component{

    render() {
        let activeMenu = '';
        let menu = this.props.menu.map((item,index) => {  
            let activeClass = '';
            if(this.props.selectedMenu === item){
                activeClass=classes.activeMark;
                activeMenu = item;
            }
            return(<div key={index} className={activeClass} onClick={()=>this.props.clicked(item)}>{item}</div>)
        })

        let MenuDetails = null 
        switch(activeMenu){
            case "Definition":
                MenuDetails = (
                    <div>
                        <h2>What is GST Registration?</h2>
                        <p>
                        Lorem ipsum dolor sit amet, consectetur adipiscing elit, 
                        sed do eiusmod tempor incididunt 
                        ut labore et dolore magna aliqua. 
                        Ut enim ad minim veniam, quis nostrud 
                        exercitation ullamco laboris nisi 
                        ut aliquip ex ea commodo consequat. Duis 
                        aute irure dolor in reprehenderit
                        in voluptate velit esse cillum dolore eu 
                        fugiat nulla pariatur. Excepteur sint occaecat cupidatat 
                        non proident, 
                        sunt in culpa qui officia deserunt mollit anim id est laborum.
                        </p>
                    </div>
                )
            case "Inclusion":
            case "Procedures":
            case "Documents":
            case "Advantages":
            case "FAQs":
        }

        return (
            <section className={classes.ServiceDescription}>
                <h2> GST Registration </h2>
                <hr></hr>
                <div className={classes.ServiceDescriptionMenu}>
                    {menu}
                </div>
                <div className={classes.MenuDetails}> 

                </div>
            </section>
        );
    }

}

export default GstRegistration;
